import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import { ChartBar, Users, CreditCard, GraduationCap, LogIn, LogOut } from 'lucide-react';
import { AuthProvider, useAuth } from './context/AuthContext';
import Home from './components/Home';
import Education from './components/Education';
import LendingCircle from './components/LendingCircle';
import Marketplace from './components/Marketplace';
import CreditScore from './components/CreditScore';
import Login from './components/Login';
import Register from './components/Register';

const PrivateRoute = ({ children }) => {
  const { user, loading } = useAuth();

  if (loading) {
    return <div>Loading...</div>;
  }

  return user ? children : <Navigate to="/login" />;
};

const Navigation = () => {
  const { user, logout } = useAuth();

  return (
    <nav className="bg-blue-600 text-white p-4">
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-2xl font-bold">InclusiveFin</h1>
        <ul className="flex space-x-4">
          <li><Link to="/" className="hover:text-blue-200">Home</Link></li>
          <li><Link to="/education" className="hover:text-blue-200">Education</Link></li>
          <li><Link to="/lending" className="hover:text-blue-200">Lending Circle</Link></li>
          <li><Link to="/marketplace" className="hover:text-blue-200">Microgrants</Link></li>
          <li><Link to="/credit-score" className="hover:text-blue-200">Credit Score</Link></li>
          {user ? (
            <li>
              <button onClick={logout} className="hover:text-blue-200 flex items-center">
                <LogOut size={18} className="mr-1" /> Logout
              </button>
            </li>
          ) : (
            <li>
              <Link to="/login" className="hover:text-blue-200 flex items-center">
                <LogIn size={18} className="mr-1" /> Login
              </Link>
            </li>
          )}
        </ul>
      </div>
    </nav>
  );
};

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <div className="min-h-screen bg-gray-100">
          <Navigation />

          <main className="container mx-auto mt-8 p-4">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />

              {/* Wrap protected routes inside PrivateRoute */}
              <Route
                path="/education"
                element={
                  <PrivateRoute>
                    <Education />
                  </PrivateRoute>
                }
              />
              <Route
                path="/lending"
                element={
                  <PrivateRoute>
                    <LendingCircle />
                  </PrivateRoute>
                }
              />
              <Route
                path="/marketplace"
                element={
                  <PrivateRoute>
                    <Marketplace />
                  </PrivateRoute>
                }
              />
              <Route
                path="/credit-score"
                element={
                  <PrivateRoute>
                    <CreditScore />
                  </PrivateRoute>
                }
              />
            </Routes>
          </main>

          <footer className="bg-blue-600 text-white p-4 mt-8">
            <div className="container mx-auto text-center">
              <p>&copy; 2024 InclusiveFin. All rights reserved.</p>
            </div>
          </footer>
        </div>
      </Router>
    </AuthProvider>
  );
};

export default App;
